package week2;

import java.util.ArrayList;
import java.util.HashMap;
import java.util.List;
import java.util.Map;

public class FindAnagrams {

    public static void main(String[] args) {
        System.out.println(findAnagrams("", ""));
    }

    public static List<Integer> findAnagrams(String s, String p) {

        Map<Character, Integer> pMap = new HashMap<>();
        Map<Character, Integer> sMap = new HashMap<>();
        List<Integer> indexes = new ArrayList<>();

        int length = p.length();

        for(int i = 0; i < p.length(); i++) {
            if(pMap.get(p.charAt(i)) == null) {
                pMap.put(p.charAt(i), 1);
            } else {
                int count = pMap.get(p.charAt(i));
                pMap.put(p.charAt(i), ++count);
            }
        }

        for(int i = 0; i <= s.length()-length; i++) {
            sMap.clear();
            int counted = 1;
            int j = i;
            while(counted <= length) {
                if(sMap.get(s.charAt(j)) == null) {
                    sMap.put(s.charAt(j), 1);
                } else {
                    int count = sMap.get(s.charAt(i));
                    sMap.put(s.charAt(j), ++count);
                }
                counted++;
                j++;
            }


            if(pMap.equals(sMap)) {
                indexes.add(i);
            } else {

            }

        }

        return indexes;
    }
}
